describe('Export page break', () => {
    let editor: DocumentEditor;
    beforeAll((): void => {
        document.body.appendChild(createElement('div', { id: 'container' }));
        DocumentEditor.Inject(Editor, Selection, WordExport, SfdtExport, EditorHistory);
        editor = new DocumentEditor({ enableEditorHistory: true, enableWordExport: true, enableEditor: true, isReadOnly: false, enableSelection: true, enableSfdtExport: true });
        editor.acceptTab = true;
        (editor.documentHelper as any).containerCanvasIn = TestHelper.containerCanvas;
        (editor.documentHelper as any).selectionCanvasIn = TestHelper.selectionCanvas;
        (editor.documentHelper.render as any).pageCanvasIn = TestHelper.pageCanvas;
        (editor.documentHelper.render as any).selectionCanvasIn = TestHelper.pageSelectionCanvas;
        editor.appendTo('#container');
    });
    afterAll((done): void => {
        editor.destroy();
        document.body.removeChild(document.getElementById('container'));
        editor = undefined;
        setTimeout(function () {
            document.body.innerHTML = '';
            done();
        }, 1000);
    });
    it('export page break validation', () => {
console.log('export page break validation');
        editor.editor.insertPageBreak();
        expect(() => { editor.save('PageBreak', 'Docx'); }).not.toThrowError();
    });

    it('serialize Paragraph invalid case validation', () => {
console.log('serialize Paragraph invalid case validation');
        expect(() => { (editor.wordExportModule as any).serializeParagraph(undefined, undefined, undefined) }).toThrowError();
    });
    it('serializeBodyItem  invalid case validation', () => {
console.log('serializeBodyItem  invalid case validation');
        expect(() => { (editor.wordExportModule as any).serializeBodyItem(undefined, undefined, undefined) }).toThrowError();
    });
    it('Texture Style validation 1', () => {
console.log('Texture Style validation 1');
        expect((editor.wordExportModule as any).getTextureStyle('Texture15Percent')).toBe('pct15');
        expect((editor.wordExportModule as any).getTextureStyle('Texture17Pt5Percent')).toBe('pct15');
    });
    it('Border Style validation 1', () => {
console.log('Border Style validation 1');
        expect((editor.wordExportModule as any).getBorderStyle('Cleared')).toBe('cleared');
        expect((editor.wordExportModule as any).getBorderStyle('Thick')).toBe('thick');
    });
    it('Tab Leader validation', () => {
console.log('Tab Leader validation');
        expect((editor.wordExportModule as any).getTabLeader ('None')).toBe('none');
    });
    it('Tab Justification validation', () => {
console.log('Tab Justification validation');
        expect((editor.wordExportModule as any).getTabJustification ('List')).toBe('num');
        expect((editor.wordExportModule as any).getTabJustification ('Clear')).toBe('clear');
    });
    it('Underline Style validation', () => {
console.log('Underline Style validation');
        expect((editor.wordExportModule as any).getUnderlineStyle  ('DotDashHeavy')).toBe('dashDotHeavy');
        expect((editor.wordExportModule as any).getUnderlineStyle  ('WavyHeavy')).toBe('wavyHeavy');
        expect((editor.wordExportModule as any).getUnderlineStyle  ('Words')).toBe('words');
    });

    // For function coverage, because this method is not referred.
    it('serializeExternalLinkImages validation', () => {
console.log('serializeExternalLinkImages validation');
        expect(()=>{ (editor.wordExportModule as any).serializeExternalLinkImages  (undefined)}).not.toThrowError();
    });
});
